if plot_singvals:
    plt.scatter(np.arange(1, len(S) + 1, 1), S)
    plt.ylabel("Singular values")
    plt.xlabel("Index")
    plt.show()

if plot_singvecs:
    plt.figure(figsize=(4, 4))
    j = 1
    for v in [v1, v2, v3, v4, v5, v6]:
        # v = v[np.nonzero(v)]
        plt.scatter(np.real(v), np.imag(v), s=6, label=f"$v_{j}$")
        j += 1
    plt.legend()
    plt.xlabel("Re")
    plt.ylabel("Im")
    plt.title("Symmetry singular vectors")
    plt.show()


